// Console.js
import React, { useState } from 'react';

const Console = () => {
  const [activeTab, setActiveTab] = useState('Console');
  const [consoleInput, setConsoleInput] = useState('');
  const [consoleOutput, setConsoleOutput] = useState([]);

  const handleConsoleInput = (e) => {
    setConsoleInput(e.target.value);
  };

  const handleConsoleSubmit = () => {
    // Process the consoleInput (e.g., execute a command)
    // For this example, let's just echo the input
    setConsoleOutput([...consoleOutput, `> ${consoleInput}`]);
    setConsoleInput('');
  };

  const tabs = ['Console', 'Elements', 'Network', 'Sources', 'Performance'];

  return (
    <div className="h-screen flex flex-col">
      <div className="p-2 bg-gray-100">
        <div className="flex">
          {tabs.map((tab) => (
            <button
              key={tab}
              className={`px-4 py-2 ${
                activeTab === tab
                  ? 'bg-gray-300'
                  : ' hover:bg-gray-300'
              }`}
              onClick={() => setActiveTab(tab)}
            >
              {tab}
            </button>
          ))}
        </div>
      </div>
      <div className="p-4 flex-grow">
        {activeTab === 'Console' && (
          <>
            {consoleOutput.map((output, index) => (
              <div key={index} className="">
                {output}
              </div>
            ))}
            <div className="flex items-center">
              <span className="">{'>'}</span>
              <input
                type="text"
                className="flex-grow bg-transparent text-white outline-none px-2"
                value={consoleInput}
                onChange={handleConsoleInput}
                onKeyDown={(e) => {
                  if (e.key === 'Enter') {
                    handleConsoleSubmit();
                  }
                }}
              />
            </div>
          </>
        )}
        {/* Render other tab content here */}
      </div>
    </div>
  );
};

export default Console;
